import Shell from "../Shell/Shell";
import TextField from "@mui/material/TextField";
import { Typography, Container } from "@mui/material";

const contact = () => {
  const properties = {
    nameContainer: {
      component: "div",
      id: "name",
    },
    email: {
      id: "email",
      type: "email",
      label: <Typography>Email</Typography>,
    },
    firstName: {
      id: "first name",
      type: "text",
      label: <Typography>first</Typography>,
    },
    lastName: {
      id: "last name",
      type: "text",
      label: <Typography>last</Typography>,
    },
  };

  return (
    <Shell
      heading="Contact Information"
      //   subheading="Click the button below to get started"
      content={
        <Container>
          <Container {...properties.nameContainer} sx={{ display: "flex" }}>
            <TextField {...properties.firstName} sx={{ mx: 5 }} />
            <TextField {...properties.lastName} sx={{ mx: 5 }} />
          </Container>
          <TextField {...properties.email} />
        </Container>
      }
    />
  );
};

export default contact;
